import React, { useContext } from 'react';
import { GlobalInfo } from './routes/Hooks'

const Child = () => {
  const { parentData } = useContext(GlobalInfo);
  let name = "Kirtishil Patil";
  return (
    <div>
      {parentData}
      <button onClick={() => alert(name)}></button>
    </div>
  )
}

export default Child
